def f(n, m):
  res = 0

  for i in range(1, n+1):
    for j in range(1, m+1):
      res += 77*(tan(i) + i**5 + 92)

  for i in range(1, n+1):
    for j in range(1, m+1):
      res -= 86*(e**j-j)
  
  print("f({0}, {1}".format(n, m) + ") = " + round_func(res))

