def f22(x):
  bin_x = bin(x)
  while len(bin_x) < 34:
    bin_x = bin_x[0:2] + '0' + bin_x[2:]
  res = 0

  for i in range(0, 32):
    if(i <= 2):
      res += int(bin_x[33 - 29 - i])* 2**i
    elif(3 <= i <= 9):
      res += int(bin_x[33 - 7 - i])* 2**i
    elif(10 <= i <= 19):
      res += int(bin_x[33 + 10 - i])* 2**i
    elif(20 <= i <= 31):
      res += int(bin_x[33 + 3 - i])* 2**i
    else:
      res += int(bin_x[2]) * 2**i
  return hex(res)

print(f22(0xe0834d24))
print(f22(0x6af669b4))

def f22(x):
  A = (x & (2 ** 10 - 1)) << 10
  B = (x & ((2 ** 17 - 1) & ~(2 ** 10 - 1))) >> 7
  C = (x & ((2 ** 29 - 1) & ~(2 ** 17 - 1))) << 3
  D = (x & ((2 ** 32 - 1) & ~(2 ** 29 - 1))) >> 29
  return A | B | C | D

